Tvåzons klimatanläggning; USB-ingång;
Interiör; Enkel fällning av baksäte via reglage i bagageutrymmet; Fäll -och delbart bakre
ryggstöd (60 / 40) med skidlucka; Förar -och passagerarsäte med manuell höjdjustering;
Mittarmstöd bak med mugghållare; Mittkonsol med förvaringsutrymmen och mugghållare;
Exteriör ; 17tum aluminiumfälgar Chicago; Dimljus fram; ECO-LED-strålkastare;
Värmedämpande vindruta.

